      return <Slider defaultValue={1} step={1} marks min={1} max={23} />;
    else return <Slider defaultValue={1} step={1} marks min={1} max={250} />;
  }

  return (
    <div className='flex flex-col '>
      <ButtonGroup variant='contained'>
        <Button> Chronological </Button>
